import React from "react";

const HomePage = () => {
  return (
    <div className="w-11/12 flex items-center border p-10">
      <div className="w-4/12">
        <span className=" text-4xl font-thin text-orange-800 flex justify-end  border">
          Welcome to your <br /> professional society !
        </span>

        <div className="flex">
          <input
            id="idValue"
            name="idValue"
            className="w-[22rem] h-12 rounded border border-orange-400 p-5 text-gray-500 focus:outline-orange-600"
          ></input>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
